var Script=function(){$("#external-events div.external-event").each(function(){var d={title:$.trim($(this).text())};$(this).data("eventObject",d);$(this).draggable({zIndex:999,revert:true,revertDuration:0})});var b=new Date();var c=b.getDate();var a=b.getMonth();var e=b.getFullYear();$("#calendar").fullCalendar({header:{left:"prev,next today",center:"title",right:"month,basicWeek,basicDay"},editable:true,droppable:true,drop:function(g,h){var f=$(this).data("eventObject");var d=$.extend({},f);d.start=g;d.allDay=h;$("#calendar").fullCalendar("renderEvent",d,true);if($("#drop-remove").is(":checked")){$(this).remove()}},events:[{title:"All Day Event",start:new Date(e,a,1)},{title:"Long Event",start:new Date(e,a,c-5),end:new Date(e,a,c-2)},{id:999,title:"Repeating Event",start:new Date(e,a,c-3,16,0),allDay:false},{id:999,title:"Repeating Event",start:new Date(e,a,c+4,16,0),allDay:false},{title:"Meeting",start:new Date(e,a,c,10,30),allDay:false},{title:"Lunch",start:new Date(e,a,c,12,0),end:new Date(e,a,c,14,0),allDay:false},{title:"Birthday Party",start:new Date(e,a,c+1,19,0),end:new Date(e,a,c+1,22,30),allDay:false},{title:"Click for Google",start:new Date(e,a,28),end:new Date(e,a,29),url:"http://google.com/"}]})}();